import { useContext } from 'react'
import { IBrandDto } from '../../../../Api/dto/IBrand'
import PanelContext from '../../../../Context/PanelContext'
import WorkingSpaceContext from '../../../../Context/WorkingSpaceContext'
import { MenuEnum } from '../../../../Enums/MenuEnums'
import BrandItem from './outputPanel-brandItem/BrandItem'
import styles from './OutputPanel.module.scss'

export default function OutputPanel() {

    function ResponseBlock() {
        const value = useContext(WorkingSpaceContext)
        const valueStore = useContext(PanelContext)

        if (value.menuState === MenuEnum.Brands) {
            if (value.controlPanelState === 'Создать' && valueStore.store?.newBrands !== undefined) {
                const data: IBrandDto[] = valueStore.store?.newBrands
                const brandsList = data.map((item, index) => {
                    return (
                        <BrandItem
                            key={index}
                            value={item}
                        ></BrandItem>)
                })
                return (
                    <div>
                        {brandsList}
                    </div>)
            }
            else if (value.controlPanelState === 'Получить' && valueStore.store?.brands !== undefined) {
                const data: IBrandDto[] = valueStore.store?.brands
                const brandsList = data.map((item, index) => {
                    return (
                        <BrandItem
                            key={index}
                            value={item}
                        ></BrandItem>)
                })
                return (
                    <div>
                        {brandsList}
                    </div>)
            }
        }
        return (<></>)
    }

    return (
        <div className={styles['outputPanel']}>
            <ResponseBlock></ResponseBlock>
        </div>
    )
}
